pub enum Node<'a> {

    /// Null trie node; could be an empty root or an empty branch entry.
    Empty,

    /// Leaf node; has key slice and value. Value may not be empty.
    Leaf(NibbleSlice, &'a [u8]),

    /// Extension node; has key slice and node data. Data may not be null.
    Extension(NibbleSlice, NodeHandle),

    /// Branch node; has slice of child nodes (each possibly null)
    /// and an optional immediate node data.
    Branch([Option<NodeHandle>; ], Option<&'a [u8]>),

    /// Branch node with support for a nibble (when extension nodes are not used).
    NibbledBranch(NibbleSlice, [Option<NodeHandle>; ], Option<&'a [u8]>),
}

pub enum NodePlan {

    /// Null trie node; could be an empty root or an empty branch entry.
    Empty,

    /// Leaf node; has a partial key plan and value.
    Leaf {
        partial: NibbleSlicePlan,
        value: Range<usize>,
    },

    /// Extension node; has a partial key plan and child data.
    Extension {
        partial: NibbleSlicePlan,
        child: NodeHandlePlan,
    },

    /// Branch node; has slice of child nodes (each possibly null)
    /// and an optional immediate node data.
    Branch {
        value: Option<Range<usize>>,
        children: [Option<NodeHandlePlan>; ],
    },

    /// Branch node with support for a nibble (when extension nodes are not used).
    NibbledBranch {
        partial: NibbleSlicePlan,
        value: Option<Range<usize>>,
        children: [Option<NodeHandlePlan>; ],
    },
}

pub enum Error<HO, CE> {

    /// The statement being verified contains multiple key-value pairs with the same key. The
    /// parameter is the duplicated key.
    DuplicateKey(Vec<u8>),

    /// The proof contains at least one extraneous node.
    ExtraneousNode,

    /// The proof contains at least one extraneous value which should have been omitted from the
    /// proof.
    ExtraneousValue(Vec<u8>),

    /// The proof contains at least one extraneous hash reference the should have been omitted.
    ExtraneousHashReference(HO),

    /// The proof contains an invalid child reference that exceeds the hash length.
    InvalidChildReference(Vec<u8>),

    /// The proof indicates that an expected value was not found in the trie.
    ValueMismatch(Vec<u8>),

    /// The proof is missing trie nodes required to verify.
    IncompleteProof,

    /// The root hash computed from the proof is incorrect.
    RootMismatch(HO),

    /// One of the proof nodes could not be decoded.
    DecodeError(CE),
}

pub enum TrieError<T, E> {

    /// Attempted to create a trie with a state root not in the DB.
    InvalidStateRoot(T),

    /// Trie item not found in the database,
    IncompleteDatabase(T),

    /// A value was found in the trie with a nibble key that was not byte-aligned.
    /// The first parameter is the byte-aligned part of the prefix and the second parameter is the
    /// remaining nibble.
    ValueAtIncompleteKey(Vec<u8>, u8),

    /// Corrupt Trie item
    DecoderError(T, E),
    InvalidHash(T, Vec<u8>),
}

pub enum TrieSpec {

    /// Generic trie.
    Generic,

    /// Secure trie.
    Secure,

    ///	Secure trie with fat database.
    Fat,
}

pub enum TrieKinds<'db, L: TrieLayout> {

    /// A generic trie db.
    Generic(TrieDB),

    /// A secure trie db.
    Secure(SecTrieDB),

    /// A fat trie db.
    Fat(FatDB),
}
